use concessionnaire
create table FactureVente (
	id_facture INT primary key identity,
	num_facture VARCHAR(50) NOT NULL UNIQUE,
	id_voiture INT FOREIGN KEY REFERENCES VoitureVente (id_voiture) UNIQUE,
	id_client INT  FOREIGN KEY REFERENCES client (id),
	prix DECIMAL(10,2),
	date DATE
);

drop table FactureVente
SET IDENTITY_INSERT FactureVente ON;


